import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Register Page</h1>

      <div classname="registerForm">
        <label>User Name</label>
        <label>Email</label>
        <label>Password</label>
        <label>User Type (superadmin, admin, student)</label>
      </div>

    </div>
  );
}

export default App;
